const ChangePassword = (props) => {

    return (
        <div className="login-page">
            <h3>Change Password</h3>
            <form className="add-form">
             <div id="mail">
                <input className="email" type="password" value={props.password} onChange={(e)=>props.handlePasswordChange(e)} id="password"  placeholder="Enter old Password" required />
            <input className="email" type="text" value={props.password} onChange={(e)=>props.handlePasswordChange(e)} id="key"  placeholder="security Key" required />
       
    <input className="email" type="password" value={props.password} onChange={(e)=>props.handlePasswordChange(e)} id="password"  placeholder="Enter New Password" required />
        </div>
        <div className="btn-container">
<button onClick={(e)=> props.loginBtn(e)} type="submit"  className="proceed-btn">Login</button>
</div>
     </form>  
      </div>
      );
}


export default ChangePassword;
